DROP TABLE IF EXISTS `orders`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `orders` (
  `id` bigint(20) unsigned NOT NULL AUTO_INCREMENT,
  `user_id` bigint(20) unsigned DEFAULT NULL,
  `lover_id` bigint(20) unsigned DEFAULT NULL,
  `scene_id` bigint(20) unsigned DEFAULT NULL,
  `last_name` varchar(32) COLLATE utf8mb4_unicode_ci NOT NULL,
  `first_name` varchar(32) COLLATE utf8mb4_unicode_ci NOT NULL,
  `last_name_furigana` varchar(64) COLLATE utf8mb4_unicode_ci NOT NULL,
  `first_name_furigana` varchar(64) COLLATE utf8mb4_unicode_ci NOT NULL,
  `postal_code` varchar(10) COLLATE utf8mb4_unicode_ci NOT NULL,
  `prefecture_id` bigint(20) unsigned DEFAULT NULL,
  `address` varchar(200) COLLATE utf8mb4_unicode_ci NOT NULL,
  `telephone` varchar(21) COLLATE utf8mb4_unicode_ci NOT NULL,
  `gender` tinyint(4) DEFAULT NULL,
  `relationship_id` bigint(20) unsigned DEFAULT NULL,
  `created_at` timestamp NULL DEFAULT NULL,
  `updated_at` timestamp NULL DEFAULT NULL,
  `generation_id` bigint(20) unsigned DEFAULT NULL,
  `user_last_name` varchar(32) COLLATE utf8mb4_unicode_ci NOT NULL,
  `user_first_name` varchar(32) COLLATE utf8mb4_unicode_ci NOT NULL,
  `user_last_name_furigana` varchar(64) COLLATE utf8mb4_unicode_ci NOT NULL,
  `user_first_name_furigana` varchar(64) COLLATE utf8mb4_unicode_ci NOT NULL,
  `user_postal_code` varchar(10) COLLATE utf8mb4_unicode_ci NOT NULL,
  `user_prefecture_id` bigint(20) unsigned DEFAULT NULL,
  `user_address` varchar(200) COLLATE utf8mb4_unicode_ci NOT NULL,
  `user_telephone` varchar(21) COLLATE utf8mb4_unicode_ci NOT NULL,
  `user_email` varchar(255) COLLATE utf8mb4_unicode_ci NOT NULL,
  PRIMARY KEY (`id`),
  KEY `orders_user_id_foreign` (`user_id`),
  KEY `orders_lover_id_foreign` (`lover_id`),
  KEY `orders_scene_id_foreign` (`scene_id`),
  KEY `orders_prefecture_id_foreign` (`prefecture_id`),
  KEY `orders_relationship_id_foreign` (`relationship_id`),
  KEY `orders_user_prefecture_id_foreign` (`user_prefecture_id`),
  CONSTRAINT `orders_lover_id_foreign` FOREIGN KEY (`lover_id`) REFERENCES `lovers` (`id`) ON DELETE SET NULL ON UPDATE CASCADE,
  CONSTRAINT `orders_prefecture_id_foreign` FOREIGN KEY (`prefecture_id`) REFERENCES `prefectures` (`id`) ON DELETE SET NULL ON UPDATE CASCADE,
  CONSTRAINT `orders_relationship_id_foreign` FOREIGN KEY (`relationship_id`) REFERENCES `relationships` (`id`) ON DELETE SET NULL ON UPDATE CASCADE,
  CONSTRAINT `orders_scene_id_foreign` FOREIGN KEY (`scene_id`) REFERENCES `scenes` (`id`) ON DELETE SET NULL ON UPDATE CASCADE,
  CONSTRAINT `orders_user_id_foreign` FOREIGN KEY (`user_id`) REFERENCES `users` (`id`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `orders_user_prefecture_id_foreign` FOREIGN KEY (`user_prefecture_id`) REFERENCES `prefectures` (`id`) ON DELETE SET NULL ON UPDATE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=1508 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;
